function getOutdoorIndx(str) {
  const arr = str.split("");
  const idx = arr.findIndex(letter => {
    return !isNaN(+letter);
  });
  const newArr = arr.slice(idx);
  const idx2 = newArr.findIndex(letter => {
    return isNaN(+letter);
  });
  return newArr.slice(0, idx2).join("");
}

